import React, { useState, useEffect, useContext } from "react";
import { CartContext } from "../Cart/Context"; // Import your CartContext
import mensWearData from './mens.json';
import womensWearData from './womens.json';
import newarrivals from './newarrivals.json';
import './Mens.css';

const MensWearPage = ({ category }) => {
  const { cart, addToCart } = useContext(CartContext); // Access cart and addToCart from context
  const [data, setData] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [sortOrder, setSortOrder] = useState(null);

  // Load data based on selected category
  useEffect(() => {
    switch (category) {
      case "mens":
        setData(mensWearData.mensWear);
        break;
      case "womens":
        setData(womensWearData.womensWear);
        break;
      case "newarrivals":
        setData(newarrivals.newArrivals);
        break;
      default:
        setData([]);
    }
  }, [category]);

  const filteredItems = selectedCategory === 'All'
    ? data.flatMap(cat => cat.items)
    : data
        .filter(cat => cat.category === selectedCategory)
        .flatMap(cat => cat.items);

  const sortedItems = [...filteredItems].sort((a, b) => {
    if (sortOrder === 'asc') return a.price - b.price;
    if (sortOrder === 'desc') return b.price - a.price;
    return 0;
  });

  return (
    <div className="container">
      {/* Category Selection */}
      <div className="category-buttons">
        <button onClick={() => setSelectedCategory('All')} className={`category-btn ${selectedCategory === 'All' ? 'active' : ''}`}>All</button>
        <button onClick={() => setSelectedCategory('Mens Wear')} className={`category-btn ${selectedCategory === 'Mens Wear' ? 'active' : ''}`}>Mens Wear</button>
        <button onClick={() => setSelectedCategory('Womens Wear')} className={`category-btn ${selectedCategory === 'Womens Wear' ? 'active' : ''}`}>Womens Wear</button>
        <button onClick={() => setSelectedCategory('New Arrivals')} className={`category-btn ${selectedCategory === 'New Arrivals' ? 'active' : ''}`}>New Arrivals</button>
      </div>

      {/* Sort Options */}
      <div className="sort-container">
        <button
          onClick={() => setSortOrder(sortOrder === 'asc' ? 'desc' : 'asc')}
          className="sort-button"
        >
          Sort by Price ({sortOrder === 'asc' ? 'Lowest to Highest' : 'Highest to Lowest'})
        </button>
      </div>

      {/* Product Listings */}
      <div className="products">
        {sortedItems.map(product => (
          <div key={product.name} className="card" style={{ width: "18rem", margin: "10px" }}>
            <img src={product.imageUrl} className="card-img-top" alt={product.name} height={300} width={300} />
            <div className="card-body">
              <h5 className="card-title">{product.name}</h5>
              <p className="card-text">Price: ₹{product.price}</p>
              <div className="card-actions">
                <button onClick={() => addToCart(product)} className="btn btn-dark">
                  <i className="fas fa-shopping-cart"></i> Add to Cart
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Cart Section */}
      <div className="cart-section">
        <h2>Cart</h2>
        {cart.length === 0 ? (
          <p>Your cart is empty.</p>
        ) : (
          <ul>
            {cart.map((item, index) => (
              <li key={index}>{item.name} - ₹{item.price}</li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default MensWearPage;
